export default {
  props: {
    value: {
      type: Boolean,
      default: false
    }
  },
  computed: {
    dialogDelete: {
      get() {
        return this.value;
      },
      set(val) {
        this.$emit('input', val);
      }
    }
  },
  methods: {
    confirmDelete() {
      this.$emit('confirm-delete');
      this.dialogDelete = false;
    },
    cancelDelete() {
      this.$emit('cancel-delete');
      this.dialogDelete = false;
    }
  }
};
